                var html_e8bb45023ac84f6c9d1fa24e0e836ea1 = $('         <div id="html_e8bb45023ac84f6c9d1fa24e0e836ea1"                 style="width: 100.0%; height: 100.0%;">                 TO CHRISTA:  	I just want you to know that I miss you an awful lot and I would be lieing if I said there was one day I didn&#39;t think about you. I felt so so close to you in such a short time. Things were going so well and then the heat came and made me irritable. I brought all the issues up to deal with them in a positive way. One minute you were fine with it the next you were accusing me of wanting some other arrangement. That was hurtful. All this hurt? Why? I feel like I went about things the right way and you basically said you didn&#39;t want to try but somehow made me feel like I was the person who&#39;s fault it was for not trying! Maybe because you thought I wanted something else? How could you ever have thought that about me? How? I wanted commitment from us after a couple of days! There is some law in psychology that talks about people acting out of self interest and I guess I like to hope that you were just trying to protect your feelings in that situation. I just wanted you to know that I was and still am over the moon that I met you and I care about you so much and so deeply and the loss of you is so much harder than i expected. It is a year later and I&#39;m still hurting. I would like to offer you a sweet sweet kiss and another one for the road and to tell you that in the short time we had together you really made it seem like my soul had found home! I miss you more than you could know. I wish I could hold your beautiful hands forever and that we would overcome anything because we knew how special and rare it was for us to meet. I&#39;m sorry for being a little different than what you are used to but when it comes to relationships I think being direct is best but it gets me in trouble and makes people uncomfortable earlier than they might like to be....it may make me seem insensitive to represent my feelings the way I do but I&#39;m not and I definitely cannot read minds but i am capable of loving and caring and overcoming and waiting and reflecting and showering you with all the love I have to give. You have touched my soul and I need to share this with you. Please hear me.</div>                 ')[0];

                var html_c7480b17816040f7b1ce6b54f25d8d29 = $('         <div id="html_c7480b17816040f7b1ce6b54f25d8d29"                 style="width: 100.0%; height: 100.0%;">                 I rarely get a chance to say - w4mw:  	Thank you to the folks who are careful to stop without blocking the crosswalk so I don&#39;t have to push my son&#39;s wheelchair into traffic to get him across a road. Thank you to the folks who have offered to help and have reached down and helped me pull his wheelchair up over a broken sidewalk or a too-high ramp. Thank you to the folks who let us board the bus first so I can get him out of the heat/rain/snow/general weather. Thank you to the folks who make sure I can sit near him on the bus - he is less anxious if he can see me. Thank you to the folks who smile at him, who look at him in a friendly way, who say hi - even if he will not respond. It does make a difference to him even if his non-neurotypical self can&#39;t always respond in a socially acceptable way. Thank you to the folks who open doors for us when they see me trying to wrangle the chair through doors that don&#39;t have that automatic open button. I&#39;m so grateful to all of you. All these little things make his difficult life a little better. Some of these are acts of empathetic humanity that he will not notice, but his mother, who sometimes exists in a bubble of focused isolation while she cares for him, does.</div>                 ')[0];

                var html_6af88c12ec0242a397bd345f5c3af7b0 = $('         <div id="html_6af88c12ec0242a397bd345f5c3af7b0"                 style="width: 100.0%; height: 100.0%;">                 You are here:  	How inefficient and cumbersome are the machines of your inquiry? How is it that every time some idea you have created in order to distill some truth between us is grander and more complicated than any posit or tenet that preceded it? What is the point of any of it, when acknowledging the distance between us would be easier as a question or a simple line of dialogue? I never understood why allocating so many obsequious intentions is more relevant to you than the entirety of your ambitions. It&#39;s like a Ferris wheel, spinning in place, watching your mind revolve around accepting another person for who they are, rather than how he or she will best suit your needs. I never asked to be standing in line, waiting for your appraisal. What a fucking waste of life.</div>                 ')[0];

                var html_caa930af29d8444293fc8651a1030217 = $('         <div id="html_caa930af29d8444293fc8651a1030217"                 style="width: 100.0%; height: 100.0%;">                 why does it have to be like this:  	not it, me. why do i have to be like this? wish i was more like them all. wish i stood in one world rather than stumbling in between yours and theirs and my half-world. why can&#39;t i just be carefree and live with the wind blowing me in whatever direction it chooses, like you and them? why must i resist even if the wind has good intentions? how do i even explain my resistance without removing the four foot walls i have built around myself to withstand the wind... i have once given up my walls and let myself get swept up with the green leaves and the pink petals and i found myself caught in a tornado that tore me limb from limb. i healed and i rebuilt my tower with three extra feet so i would never have to suffer that demeaning state once more. i never want to suffer that fate again. on the other hand; what if the next big wind gust takes me not into a tornado but into a paradise? where i will never have to worry about the wind again because it has taken me to my final resting place. where i will never have to seal myself off in that tower of sadness and anger. a paradise where i could be free to let myself take down even the foundation of that tower to be truly, truly free of the monstrosity. it&#39;s impossible to discern where the wind building up now will take me. i don&#39;t know if i want to let it take, take me to you. or if it&#39;s better to stay grounded and wait for something more. wait for something stronger. is there a knowledge in your world or their world that is no available to me, in my half-world, that has the answers to my questions? is it because i cannot find myself on my feet in either world that this knowledge is unattainable to me? maybe i&#39;ll stay in my tower, in the half-world, and be an observer and documentor for you and the others. maybe i&#39;ll be content here; without sorrow and without joyfulness.</div>                 ')[0];

                var html_53bac15afd764b01b1b1aad1055e8558 = $('         <div id="html_53bac15afd764b01b1b1aad1055e8558"                 style="width: 100.0%; height: 100.0%;">                 Southwest line at MSP on Friday AM:  	Omg, you were loveliness personified. White cargo pants, navy blue cardigan and tan; good grief, you were so tan. Simply stunning. I was having such an uneventful morning - everything just playing out as it&#39;s supposed to; nothing remarkable. Catching a dreadfully early AM flight. And I fly all the time. Then it happens. We cross paths. I notice you. In that instant, your mere presence enlivened me, woke me up, intrigued me. I became so alive. Aware of you. Nervous. Befuddled. Almost shy. And so delightfully happy. Secretly exuberant inside. It&#39;s that magical feeling of mutual noticing, then attending - that can be felt for another, whatever the reason. Some kind of mystical draw in its most purest form. But so grand and true. Simply magnetic. Life affirming. Oh, the delicious proximity, sheer immediacy of you! Imagine that I should be so fortunate! Graced. It appears you&#39;re married and why shouldn&#39;t you be! You&#39;re beautiful. And please forgive me the seemingly superficial judgement. But you&#39;re kind too (reminded the young girl not to forget her belt - how NICE is that?). Anyway, thank you. Thank you for your presence. The magic and wonder of it all. For awakening me. The curiosity, the intrigue, unmistakable pull. The pure blissful bewilderment of the moment. The happiness and excitement you kindled within me. I hope you had a nice flight. And I hope you have a great life! Ciao</div>                 ')[0];

                var html_dc21ed45365a4ad1bd228658b5f9f5a5 = $('         <div id="html_dc21ed45365a4ad1bd228658b5f9f5a5"                 style="width: 100.0%; height: 100.0%;">                 Light Rail Conversation:  	You have my number, so I suppose you can use it, or not use it. All the same, I wanted to thank you for helping to fend off the older guy making unwanted advances at me. I really wanted to have the presence of mind to shake that off and flirt with you. As it stands, though, you seem like a kind person who knows how to have a decent conversation. Thank you for treating me like a person with autonomous will. You know, because I AM a person with autonomous will. Please tell me more about the antics of your kindergarten students, and what medium you prefer for sculpture. You&#39;re clearly intelligent and talented. I&#39;d be up for a date if you were. (No, the irony is not lost on me. Still, I only date people I&#39;d also like to be friends with.) If not date, then more conversations, and tabletop gaming. That&#39;d be cool with me. I play Magic, which is more of a way of life than a game. If you play too, let&#39;s go draft. :) It occurs to me that I was wearing my Pride shirt. You might believe I am gay. I&#39;m actually pansexual. So, not straight either... but potentially interested in you. I don&#39;t know your last name, so I very much doubt I&#39;d ever find you again on my own. But I really wanted to just say thanks, and maybe we&#39;ll meet again. Carry on.</div>                 ')[0];
